import './welcome.css';

function Welcome() {
  return (
    <div className="welcome">
      <header className="welcome-header">
        <p className="welcome-header-text">
          Welcome to
        </p>
        <p className="welcome-header-sub-text">
          '[INSERT APP NAME]'
        </p>
      </header>
    </div>
  );
}

export default Welcome;
